(function(){var d=$(".m-contact--form");var a=$("#mailAddress");var c=$("#subject");var e=$("#message");var b=$("#token");var g=$("#language");var f=$("#send");var h=$(".m-contact--finish");f.on("click",function(){f.prop("disabled",true);a.prop("disabled",true);c.prop("disabled",true);e.prop("disabled",true);var i={email:a.val(),subject:c.val(),message:e.val(),token:b.val(),l:g.val()};$.post(window.location.href,i,function(j){if(j.success){h.addClass("m-contact--finish_success")}else{h.addClass("m-contact--finish_error")}d.fadeOut(function(){h.text(j.message).fadeIn()})},"json")})})();